package de.fivethree.immoapps.backend.model.report;

public class InspectionImageReportModel {
    private String name;
    private String type;
    private String data;

    public InspectionImageReportModel(String name, String type, String data) {
        this.name = name;
        this.type = type;
        this.data = data;
    }

    public String getName() {
        return name;
    }

    public String getType() {
        return type;
    }

    public String getData() {
        return data;
    }
}
